import React, { Component } from "react";


class Login extends Component{

    render() {
        return (
            <React.Fragment>
            <div className="display-1 loginContainer m-2">
                <h5 className="display-1">Hello from loginContainer</h5>
            </div>
            </React.Fragment>
        );
    }
}
export default Login;
